INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(1, 'Planta eléctrica Amplia Gama >800 Kva P900-1', , 'La planta eléctrica P900-1 es una solución de energía confiable y potente con capacidad superior a 800 KVA. Diseñada para proveer una fuente continua y estable de energía en diversas situaciones, su capacidad de más de 900 KVA la hace adecuada para alimentar equipos y aplicaciones industriales, comerciales o residenciales. Asegura un suministro constante de energía, incluso en emergencias', 'La planta eléctrica P900-1 destaca por su potencia superior a 900 KVA, lo que la hace ideal para aplicaciones de gran escala. Es confiable y estable, garantizando un suministro ininterrumpido de energía en condiciones exigentes. Su versatilidad permite su uso en diversas industrias y situaciones, mientras que su eficiencia energética y fácil operación la hacen económica y práctica. Además, cuenta con sistemas de seguridad integrados para una protección completa.', 1, 1);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(2, 'Filtros FARR', , 'Los filtros FARR son una solución eficiente y confiable para mejorar la calidad del aire en diversos entornos. Estos filtros se caracterizan por su diseño avanzado y su capacidad para atrapar partículas contaminantes y alérgenos, brindando un aire más limpio y saludable. Los filtros FARR son ampliamente utilizados en sistemas de ventilación y climatización en edificios comerciales, industriales y residenciales, garantizando un ambiente más seguro y confortable para quienes lo habitan.', 'Los filtros FARR son altamente eficientes en la captura de partículas nocivas en el aire, como polvo y bacterias. Disponibles en diversas opciones, son duraderos y fáciles de instalar y reemplazar. Mejoran la calidad del aire, reduciendo alergias y enfermedades respiratorias, y contribuyen a la eficiencia energética. Con los filtros FARR, aseguras un ambiente limpio y saludable en cualquier lugar.', 1, 1);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(3, 'Fusibles 15ª', , 'Los fusibles 15A son dispositivos de protección eléctrica diseñados para limitar la corriente en un circuito y prevenir sobrecargas. Son ideales para aplicaciones domésticas y comerciales de baja potencia. Estos fusibles están calibrados para manejar una corriente máxima de 15 amperios y se utilizan comúnmente en sistemas eléctricos para proteger equipos y dispositivos contra cortocircuitos y sobrecargas. Son fáciles de instalar y reemplazar, ofreciendo una solución eficiente y segura para garantizar la protección de tus circuitos eléctricos. ¡No dejes que los picos de corriente dañen tus dispositivos, confía en los fusibles 15A para una protección confiable!\r\n', '', 2, 1);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(4, 'Motores Eléctricos ABB IEC', , 'Los motores eléctricos ABB IEC son dispositivos de alta calidad y rendimiento diseñados para una amplia gama de aplicaciones industriales. Estos motores se destacan por su eficiencia energética, fiabilidad y durabilidad. Fabricados por ABB, una reconocida empresa en el campo de la ingeniería eléctrica, estos motores cumplen con los estándares internacionales y ofrecen un rendimiento óptimo en diversas condiciones de trabajo. Los motores eléctricos ABB IEC están disponibles en diferentes tamaños y potencias para adaptarse a las necesidades específicas de tu aplicación. Además, cuentan con características como protección contra sobrecargas, diseño compacto y bajo nivel de ruido. Con los motores eléctricos ABB IEC, puedes asegurar un funcionamiento eficiente y confiable de tus equipos industriales, maximizando la productividad y reduciendo los costos de mantenimiento. ¡Opta por la calidad y confiabilidad de los motores eléctricos ABB IEC para potenciar tus procesos industriales!', '', 3, 2);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(5, 'Motores Eléctricos ABB Baldor Reliance Nema', , '\r\nLos motores eléctricos ABB Baldor Reliance Nema son dispositivos de alta calidad y rendimiento diseñados para diversas aplicaciones industriales. Fabricados por ABB, una empresa líder en ingeniería eléctrica, estos motores cuentan con la marca Baldor Reliance, reconocida por su excelencia. Cumplen con los estándares de la NEMA de Estados Unidos y ofrecen un rendimiento confiable y eficiente. Disponibles en diferentes tamaños y potencias, se adaptan a tus necesidades específicas.\r\n\r\n\r\n\r\n\r\n\r\n', '- Alta eficiencia energética.\r\n- Construcción de alta calidad y robustez.\r\n- Protección contra sobrecargas.\r\n- Vida útil prolongada.\r\n- Operación silenciosa y confiable.\r\n- Cumplimiento de los estándares NEMA.\r\n- Disponibles en diversos tamaños y potencias.\r\n- Ideal para aplicaciones industriales exigentes.\r\n', 2, 2);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(6, 'Dodge CST - Transmisión mecánica de arranque controlado para Fajas Transportadoras', , 'La transmisión mecánica de arranque controlado Dodge CST es un componente de alta calidad diseñado para fajas transportadoras. Fabricada por Dodge, una marca reconocida en transmisiones mecánicas, ofrece rendimiento confiable y eficiente en aplicaciones industriales. Diseñada para un arranque suave en las fajas transportadoras, previene desgaste prematuro y problemas de tensión. Con la transmisión mecánica Dodge CST, optimizas la operación de tus fajas y aumentas la eficiencia en el transporte.', 'Diseñada para fajas transportadoras en aplicaciones industriales.\r\n- Control de arranque suave para prevenir desgaste y tensiones innecesarias.\r\n- Rendimiento confiable y eficiente.\r\n- Construcción robusta y duradera.\r\n- Fácil instalación y mantenimiento.\r\n- Contribuye a la optimización del proceso de transporte.\r\n- Compatible con una amplia gama de fajas transportadoras.\r\n- Permite un funcionamiento suave y seguro de las fajas.\r\n- Reduce los costos de mantenimiento y reemplazo.\r\n', 1, 3);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(7, 'Reductor para alto torque MagnaGear®', , 'El reductor para alto torque MagnaGear® es un componente excepcional diseñado para aplicaciones que requieren un alto rendimiento y capacidad de carga. Fabricado con los más altos estándares de calidad, este reductor proporciona un funcionamiento suave y confiable en entornos industriales exigentes. El MagnaGear® es conocido por su resistencia excepcional y su capacidad para manejar cargas de alto torque con facilidad. Con este reductor, puedes mejorar la eficiencia de tus equipos y garantizar una operación continua y confiable.\r\n', '- Construcción robusta y duradera para resistir condiciones industriales rigurosas.\r\n- Alta capacidad de manejo de torque para garantizar un rendimiento confiable.\r\n- Funcionamiento suave y silencioso para minimizar las vibraciones y el ruido.\r\n- Amplia variedad de tamaños y configuraciones para adaptarse a diferentes necesidades.\r\n- Lubricación de por vida para un mantenimiento sencillo y reducción de costos.\r\n- Sellos de alta calidad que evitan la entrada de contaminantes y prolongan la vida útil del reductor.\r\n- Diseño modular que permite una fácil instalación y reemplazo de componentes.\r\n- Eficiencia energética para reducir el consumo de energía y los costos operativos.\r\n- Compatibilidad con una amplia gama de aplicaciones industriales.\r\n- Marca reconocida y confiable en la industria de reductores de alta potencia.\r\n', 1, 3);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(8, 'Clutch / Brake Modules', , 'Los módulos de clutch/brake son componentes esenciales en sistemas de transmisión y control de movimiento industrial. Su diseño compacto y de alta calidad permite un control preciso y confiable del embrague y freno, logrando detener, arrancar y controlar el movimiento eficientemente. Son ideales para aplicaciones que demandan un rendimiento excepcional y respuesta rápida. Estos módulos altamente versátiles se adaptan a una amplia gama de maquinarias y sistemas de automatización.', 'Los módulos de clutch/brake proporcionan un control preciso del embrague y freno, con alta capacidad de torque para aplicaciones de alto rendimiento. Su diseño compacto facilita la instalación y se adaptan a diferentes maquinarias. Son duraderos y ofrecen una respuesta rápida y segura en frenado y arranque. Estos módulos son versátiles y compatibles con diversos sistemas de control, garantizando un rendimiento confiable en entornos industriales exigentes. Su calidad y eficiencia los hacen ideales para mejorar la seguridad y productividad en aplicaciones industriales.', 1, 3);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(9, 'Torque tamer', , 'El Torque Tamer es un dispositivo innovador diseñado para controlar y optimizar el torque en sistemas de transmisión mecánica. Con su avanzada tecnología y diseño de vanguardia, el Torque Tamer ofrece una solución eficiente y confiable para aplicaciones que requieren un control preciso del torque. Este dispositivo es ideal para mejorar el rendimiento y la eficiencia en una amplia gama de maquinarias y equipos industriales.', 'El Torque Tamer es un dispositivo que permite un control preciso y ajustable del torque en sistemas de transmisión, mejorando la eficiencia de la maquinaria. Su diseño compacto facilita su instalación y configuración según las necesidades de la aplicación. Equipado con tecnología avanzada, optimiza el torque para adaptarse a diferentes condiciones de carga y velocidad, lo que mejora la productividad y seguridad en el entorno de trabajo. Además, contribuye a la eficiencia energética y ofrece durabilidad y confiabilidad en entornos industriales exigentes. El Torque Tamer es versátil y puede utilizarse en diversas industrias y aplicaciones. Si buscas mejorar el rendimiento y prolongar la vida útil de tus equipos, el Torque Tamer es una solución efectiva y confiable.', 2, 3);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(10, 'Chumaceras con rodamiento de bola', , 'Las chumaceras con rodamiento de bola son componentes esenciales para la industria que permiten el montaje y soporte de ejes giratorios. Estas chumaceras están diseñadas para ofrecer una solución confiable y duradera en una amplia gama de aplicaciones industriales. Su diseño versátil y eficiente garantiza un rendimiento óptimo y una larga vida útil, brindando estabilidad y soporte a los ejes y reduciendo la fricción.', '\r\nLas chumaceras con rodamiento de bola son componentes duraderos y resistentes, ideales para el montaje y soporte de ejes giratorios en diversas aplicaciones industriales. Su diseño con rodamientos de bola garantiza un movimiento suave y eficiente del eje, reduciendo la fricción y el desgaste. Son versátiles en el montaje, fáciles de instalar y ofrecen un rendimiento de alta precisión, lo que mejora la eficiencia en la transmisión de energía. Además, reducen la fricción y el calentamiento, asegurando un funcionamiento suave y una menor pérdida de energía. Brindan un soporte resistente y estable para prevenir vibraciones y desalineaciones. Las chumaceras con rodamiento de bola son ampliamente utilizadas en diversas industrias, como sistemas de transporte, maquinaria agrícola y equipos de fabricación. Si buscas mejorar la productividad y eficiencia en tus operaciones, estas chumaceras son una opción confiable y eficiente.', 3, 4);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(11, 'Chumaceras con rodamiento esférico', , 'Las chumaceras con rodamiento esférico son componentes esenciales para la industria que brindan soporte y permiten el movimiento giratorio de ejes en aplicaciones industriales. Estas chumaceras están diseñadas con un rodamiento esférico que se adapta a desalineaciones y cargas axiales, proporcionando un rendimiento confiable en entornos exigentes. Su diseño robusto y duradero garantiza una larga vida útil y un funcionamiento suave.', '\r\nLas chumaceras con rodamiento esférico son componentes versátiles que ofrecen múltiples opciones de montaje, adaptándose a diversas configuraciones y aplicaciones industriales. Su rodamiento esférico permite cierta desalineación, mejorando la vida útil del rodamiento al compensar pequeñas desviaciones en el eje. Estas chumaceras resisten cargas axiales y están diseñadas con materiales duraderos y tratamientos superficiales adecuados para resistir el desgaste, la corrosión y condiciones adversas. Permiten una lubricación eficiente, contribuyendo a un funcionamiento suave y una mayor vida útil del rodamiento. Su diseño facilita la instalación y el mantenimiento, ahorrando tiempo y esfuerzo. Son ampliamente utilizadas en diversas industrias, como maquinaria pesada, equipos de minería y sistemas de transporte. Brindan estabilidad, un rendimiento confiable y reducen las vibraciones, mejorando la eficiencia en la transmisión de energía.', 2, 4);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(12, 'Chumaceras con rodamiento liso', , 'Las chumaceras con rodamiento liso son elementos esenciales en aplicaciones industriales que requieren un soporte confiable y de baja fricción para ejes. Estas chumaceras están diseñadas con un rodamiento liso, también conocido como casquillo de deslizamiento, que permite un movimiento suave y sin fricción entre el eje y la chumacera. Su diseño simple y eficiente las convierte en una opción ideal para aplicaciones que requieren un funcionamiento silencioso y de bajo mantenimiento.', '- Baja fricción: El rodamiento liso proporciona un deslizamiento suave entre el eje y la chumacera, lo que reduce la fricción y el desgaste, y minimiza la generación de calor.\r\n- Funcionamiento silencioso: Gracias a su diseño de baja fricción, las chumaceras con rodamiento liso ofrecen un funcionamiento silencioso, lo que las hace ideales para aplicaciones sensibles al ruido.\r\n- Bajo mantenimiento: Estas chumaceras requieren un mantenimiento mínimo, ya que no tienen elementos rodantes que necesiten lubricación periódica o ajustes. Esto reduce los costos de mantenimiento y el tiempo de inactividad de los equipos.\r\n- Amplia aplicabilidad: Las chumaceras con rodamiento liso se utilizan en una variedad de aplicaciones industriales, como sistemas de transporte, maquinaria agrícola, equipos de impresión, entre otros.\r\n', 1, 4);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(13, 'Chumaceras con rodamiento cónicos montados', , 'Las chumaceras con rodamiento cónico montado son componentes esenciales en aplicaciones industriales que requieren un soporte sólido y confiable para ejes. Estas chumaceras están diseñadas con rodamientos cónicos integrados, lo que les permite soportar cargas pesadas y proporcionar una mayor capacidad de carga radial y axial. Su estructura robusta y su montaje sencillo las convierten en una opción ideal para una amplia gama de aplicaciones industriales.\r\n', '- Alta capacidad de carga: Las chumaceras con rodamiento cónico montado están diseñadas para soportar cargas pesadas tanto en dirección radial como axial, lo que las hace ideales para aplicaciones que requieren resistencia y estabilidad.\r\n- Alineación precisa: El diseño cónico del rodamiento permite una alineación precisa del eje, lo que minimiza la vibración y el desgaste prematuro del rodamiento.\r\n- Montaje sencillo: Estas chumaceras están diseñadas para un montaje fácil y rápido. El rodamiento cónico viene preajustado y montado en la chumacera, lo que reduce el tiempo de instalación y asegura un ajuste correcto.\r\n- Durabilidad y resistencia: Fabricadas con materiales de alta calidad y tratamientos superficiales adecuados, las chumaceras con rodamiento cónico montado ofrecen una excelente resistencia al desgaste, corrosión y condiciones ambientales adversas.\r\n- Mantenimiento sencillo: Su diseño permite un acceso fácil al rodamiento para tareas de mantenimiento, lo que facilita la lubricación y la inspección periódica.\r\n', 4, 4);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(14, 'DRIVE H100, 220V, 7.5HP, 22A', , 'El DRIVE H100 es un variador de velocidad diseñado para controlar motores eléctricos en aplicaciones industriales. Con una potencia de 7.5HP y una corriente nominal de 22A, este variador proporciona un control preciso y eficiente de la velocidad del motor. Su diseño compacto y de alta calidad lo convierte en una opción confiable para optimizar el rendimiento de tus sistemas.', '- Potencia y rendimiento: Con una capacidad de 7.5HP, el DRIVE H100 ofrece una potencia adecuada para aplicaciones industriales de mediana y alta demanda.\r\n- Control de velocidad: Permite ajustar la velocidad del motor de forma precisa y flexible, lo que proporciona un control óptimo sobre el rendimiento de tus equipos.\r\n- Conexión y compatibilidad: El DRIVE H100 se conecta fácilmente a motores eléctricos de 220V, asegurando una integración sencilla en tus sistemas existentes.\r\n- Protección integrada: Incorpora funciones de protección como protección contra sobrecargas, cortocircuitos y sobre temperatura, garantizando la seguridad y la protección tanto del variador como del motor.\r\n', 2, 5);
INSERT INTO `productos` (`id`, `nombre`, `imagen`, `descripcion`, `caracteristicas`, `stock`, `fk_categoria`) VALUES
(15, 'Salicru H100, 220v, 22A', , 'El Salicru H100 es un estabilizador de tensión diseñado para proteger tus equipos eléctricos y electrónicos de posibles fluctuaciones en el suministro eléctrico. Con una capacidad de 220V y una corriente nominal de 22A, este estabilizador proporciona una regulación precisa y confiable de la tensión, asegurando un funcionamiento estable y seguro de tus dispositivos.\r\n', '- Regulación de tensión: El Salicru H100 mantiene la tensión de salida en un rango seguro y estable, protegiendo tus equipos de variaciones perjudiciales en el suministro eléctrico.\r\n- Capacidad de carga: Con una capacidad de 220V y una corriente nominal de 22A, este estabilizador puede manejar una carga considerable, siendo adecuado para diversos equipos y sistemas eléctricos.\r\n- Protección integral: Además de regular la tensión, el Salicru H100 proporciona protección contra sobretensiones, cortocircuitos y picos de corriente, salvaguardando tus dispositivos ante eventos eléctricos adversos.\r\n- Diseño compacto: Su diseño compacto y de fácil instalación te permite ubicarlo en espacios reducidos sin problemas, adaptándose a las necesidades de tu entorno.\r\n- Indicadores LED: Cuenta con indicadores luminosos que te brindan información visual sobre el estado del estabilizador y su funcionamiento.\r\n', 2, 5);

